import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => {
  return (
    <div className="NavBar">
      <div className="col-sm-3">
        <Link to="#" className="NavBarItems">Boxing</Link>
        <Link to="#" className="NavBarItems">Boxing</Link>
      </div>
      <div className="col-sm-3">
        <Link to="#" className="NavBarItems">Boxing</Link>
        <Link to="#" className="NavBarItems">Boxing</Link>
      </div>
    </div>
  );
};

export default NavBar;
